import React,{useState, useEffect} from 'react'
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { DeleteOutline,Edit } from '@material-ui/icons';
import { Link} from 'react-router-dom'
import './dificultList.css'
const axios = require('axios');

export default function DificultList() {


    const [dificults, setDificults] = useState([])

    useEffect(() =>{
            axios.get('http://localhost:4500/api/dificultad')
            .then(res => {setDificults(res.data)})
            .catch(console.log)
   },[setDificults]) 



    return (
        <div className='dificultList'>

            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                    <TableHead>
                        <TableRow>

                            <TableCell align="left">Nombre</TableCell>
                            <TableCell align="left">Editar</TableCell>
                            <TableCell align="left">Eliminar</TableCell>

                        </TableRow>
                    </TableHead>
                    <TableBody>
                    {
                        dificults.map((item) => (
                            <TableRow key={item.id} sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>

                            <TableCell component="th" scope="row">
                            {item.nombre}
                            </TableCell>

                            </TableRow>
                        ))
                    }
                    </TableBody>
                </Table>
            </TableContainer>

        </div>
    )
}
